import React from 'react';

function Cards(props){
    return (
        <>
            <div className='cards'>
            <div className='card'>
                <img src={props.imgSrc} alt = "pic" className='card_img' />
                <div className='card_info'>
                    <span className='card_property'>{props.title}</span>
                    
                </div>
            </div>
            </div>
        </>
    );
}
